import React, { useState } from 'react';
import ReactDOM from 'react-dom';

const App=()=>{
    const name='';
    const [input,setName]=useState(name);
    const ChangeText=()=>{
        setName(name);
    }
    return(
        <>
            <h1>Hello {input}</h1>
            <input type="text" id="text" name='text'/>
            <button onClick={ChangeText}> Submit</button>
        </>
    )
}

export default App;
